import React from "react";
import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";

const DialogItem = (props) => {
  let path = "/dialogs/" + props.id;
  return (
    <div>
      <NavLink className = {s.DialogItem} to={path}>{props.name}</NavLink>
    </div>
  )
};

const Massage = (props) => {
  return <div className={s.massage}>{props.massage}</div>
};

const Dialogs = () => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogsItems}>
        <DialogItem name="Victor" id="1" />
        <DialogItem name="July" id="2" />
        <DialogItem name="Kate" id="3" />
        <DialogItem name="Nasty" id="4" />
        <DialogItem name="Irina" id="5" />
      </div>
      <div className={s.massages}>
          <Massage massage = "Hi!What's up?" />
          <Massage massage = "Great" />
          <Massage massage = "Yo" />
          <Massage massage = "Yo" />
      </div>
    </div>
  );
};

export default Dialogs;
